final void seek(TermInfo ti, Term term) throws IOException {
  super.seek(ti, term);
  if (ti != null)
    lazySkipPointer = ti.proxPointer;

  lazySkipProxCount = 0;
  proxCount = 0;
  payloadLength = 0;
  needToLoadPayload = false;
}

